Description
. Body (
Figs. 26–27
) rather large. Colour uniform green or bluish green. Head (
Fig. 31
) and frontal shield approximately as high as wide with ridge of frontal shield produced into prominent point at apex. Prothorax with fine scattered tubercles on dorsal surface, more so in female; lateral margin finely denticulate. Fore leg (
Fig. 32
) with inner face of coxa without markings, anterior margin with 9–11 small denticles; inner face of fore femur with large dark patch proximal to claw groove (not apparent in some specimens) and three small dark spots distal of claw groove; femora of mid and hind legs often orange red in proximal half. Wings of male longer than abdomen, those of female shorter than abdomen; ventral surface of costal area of tegmen dark bluish grey in anterior half; discoidal area completely opaque in female, only partly so in male; hind wing with costal and discoidal area yellowish green, anal area hyaline.Abdomen of female with posterior margin of fourth and particularly fifth sternite curved ventrally. Male genitalia (
Fig. 33
) with moderately elongate 
apr
, narrowed distally; 
pa
with anterior hook-like projection and posterior knob-like projection; distal projections of 
dpr
of moderate length, anterior one longer than posterior one.
